import React from "react";
import produtos from '../../data/produtos';
import './TabelaProdutoEstilo.css'

export default (props) => {

    function getLinhas() {
        return produtos.map(produto => {
            return (
                <tr>
                    <td>{produtos.id}</td>
                    <td>{produtos.nome}</td>
                    <td>R$ {produtos.preco}</td>
                </tr>
            )
        })
    }

    return (
        <div>
            <table border="1">
                <thead>
                    <tr>
                        <td>Id</td>
                        <td>Nome</td>
                        <td>Preco</td>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        {getLinhas}
                    </tr>
                </tbody>
            </table>
        </div>
    )
}
